

app.controller("startup_ctrl",['$scope','$rootScope','$translate','$compile','$msThemes','$controller','$location','$http','$interval', '$mdSidenav','$mdDialog','$timeout', function($scope,$rootScope,$controller,$location,$http,$translate,$compile,$interval,$msThemes,$mdSidenav,$mdDialog,$timeout){
    
	$scope.app = {
		theme : welcome.configs.theme,
		backgroundImage : "data:image/png;base64,",
		guide : "data:image/gif;base64,",
		tabs : [
			{color:"#D81B60", img: "data:image/jpeg;base64,"},
			{color:"#8E24AA", img: "data:image/png;base64,"},
			{color:"#10B7CC", img: "data:image/png;base64,"},
			{color:"#FFB300", img: "data:image/png;base64,"},
			{color:"#3E4DAE", img: "data:image/png;base64,"},
			{color:"#DD191D", img: "data:image/png;base64,"},
			{color:"#F55421", img: "data:image/png;base64,"},
			{color:"#0288D1", img: "data:image/png;base64,"},
			{color:"#84B94B", img: "data:image/jpeg;base64,"}
		],
		init: function(){
			$this = this;
			
			// $rootScope.appRoot.check(welcome.templates.startup, welcome.templates.bureau, ["mode"]);
			welcome.closeWindowsLoader();
		},
		openPage : function(name){
			if(welcome.templates[name])
				$rootScope.appRoot.addTemplate(welcome.templates[name]);
		},
		menuCenter : function(item){
			if(item.name == "retour sur le site")
				window.location.href="../";
		}

	}

	$rootScope.startup_ctrl = $scope.app;

}]);

